    def login(self):
        if self.txtusernamelogin.text() == "" or self.txtpasswordlogin.text() == "":
                pyautogui.alert("Enter UserName and Password")
        elif role == "Manager" and self.txtusernamelogin.text() == manager.username and self.txtpasswordlogin.text() == manager.password:
                self.showManager()
        elif role == "Employee"  and self.isvalidemployee() == True:
                self.showEmployee()
        elif role == "Rider" :
                temp = self.isvalidrider()
                if temp != None:
                        global accountRID 
                        accountRID.ID = temp.ID
                        accountRID.name = temp.name
                        accountRID.username = temp.username
                        accountRID.phoneNo = temp.phoneNo
                        accountRID.salary = temp.salary
                        accountRID.bonus = temp.bonus
                        self.showRider()
        else:
                pyautogui.alert("Invalid UserName or Password")
        
                
