    def ProductPerformance(self):
        global orders
        s = orders.head
        temp = [[0,0,0]]
        total = 0
        while s != None:
                flag = True
                for i in temp:
                        if s.medicine == i[0]:
                                flag = False
                                i[1] =int (i[1])+ int(s.quantity)
                                total = total + int(s.quantity)
                if flag == True:
                        temp.append([s.medicine,s.quantity,s.price])
                        total = total + int(s.quantity)
                s = s.next
        # print(temp)
        # temp.remove[temp[0]]
        # print(temp)
        pdf = FPDF()
        pdf.add_page()
